    public class DMIOpenDataClientTests : BaseIntegrationTest
    {

        private Coordinates coordinatesOfMyApartment = new Coordinates { Latitude = 55.6761, Longitude = 12.5683 };

        public DMIOpenDataClientTests(IntegrationTestWebAppFactory factory) : base(factory)
        {
        }

        [Fact]
        public async void GetMeanTemperaturePerHour_ReturnsTemperatureList()
        {
            // Arrange
            var startTime = new DateTime(2022, 1, 1, 0, 0, 0); ;
            var endTime = new DateTime(2022, 1, 1, 23, 59, 59, 999);

            HttpClient mockHttpClient = createHttpClientForWeatherApi();

            var client = new DmiWeatherApi(mockHttpClient);

            // Act
            var result = await client.GetTemperature(coordinatesOfMyApartment, startTime, endTime, TimeResolution.Hour);

            // Assert
            Assert.All(result, date => Assert.InRange(date.Item1, startTime, endTime));
            Assert.Equal(expectedResult, result);
        }
        [Fact]
        public async void StartTimeLaterThanEndTime_Fail()
        {
            // Arrange
            var startTime = new DateTime(2022, 1, 1, 23, 59, 59, 999);
            var endTime = new DateTime(2022, 1, 1, 0, 0, 0);

            HttpClient mockHttpClient = createHttpClientForWeatherApi();

            var client = new DmiWeatherApi(mockHttpClient);

            // Act

            List<(DateTime, double)>? result = null;
            ArgumentException? exception = null;

            try
            {
                result = await client.GetTemperature(coordinatesOfMyApartment, startTime, endTime, TimeResolution.Hour);
            }
            catch (ArgumentException e)
            {
                exception = e;
            }

            // Assert
            Assert.Null(result);
            Assert.NotNull(exception);

        }

        private HttpClient createHttpClientForWeatherApi()
        {
            string dmiApiStation = "https://dmigw.govcloud.dk/v2/metObs/collections/station/items";
            string dmiApiData = "https://dmigw.govcloud.dk/v2/metObs/collections/observation/items";

            MockHttpMessageHandler mockHttpMessageHandler = new MockHttpMessageHandler();

            HttpContent httpContentStation = new StringContent(responseContentStation);
            mockHttpMessageHandler.When(dmiApiStation).Respond(HttpStatusCode.OK, httpContentStation);

            HttpContent httpContentData = new StringContent(responseContentData);
            mockHttpMessageHandler.When(dmiApiData).Respond(HttpStatusCode.OK, httpContentData);

            return new HttpClient(mockHttpMessageHandler);
        }




